import React from 'react'

const Tag = () => {
  return (
    <>

      <div className="circular_div bg-blue-900 w-full flex justify-start items-center p-4 mt-4 rounded-2xl">

        <p className='text-white font-bold'>Slack is your digital HQ.</p>
        <p className='text-white'>Meet new features keeping teams connected in work-from-anywhere world.</p>

      </div>

    </>
  )
}

export default Tag
